webpackJsonp([70262619964164],{1140:function(e,a){e.exports={data:{markdownRemark:{html:'<p>This episode, I talk about my coding journey and how coding helps us to solve more problems as learning experience designers. You  may be evaluating whether or not learning to code is a worthwhile endeavor. I show how coding has helped me to expand my solution options, as well as why coding may not be for everyone.</p>\n<iframe src="https://simplecast.com/e/47495?style=medium-light" width="100%" height="94px" frameborder="0" scrolling="no" seamless=""></iframe>\n<p>I really want to hear what you guys think of this episode. I’ve heard from several IDs who are learning to code or wanting advice about whether they should learn to code. What would you say to them?</p>',frontmatter:{date:"November 03, 2016",path:"/blog/dearid-on-learning-to-program",title:"#DearID: On Learning to Program",tags:["coding","learning experience design","learning to code","programming","web development"],categories:["Coding","Dear ID Show"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1,src:"/static/On-Learning-to-Program-c5deb1b9dee958301d13e28462860194-81d39.png",srcSet:"/static/On-Learning-to-Program-c5deb1b9dee958301d13e28462860194-9a8d1.png 203w,\n/static/On-Learning-to-Program-c5deb1b9dee958301d13e28462860194-c53f9.png 405w,\n/static/On-Learning-to-Program-c5deb1b9dee958301d13e28462860194-81d39.png 810w,\n/static/On-Learning-to-Program-c5deb1b9dee958301d13e28462860194-e460a.png 1215w,\n/static/On-Learning-to-Program-c5deb1b9dee958301d13e28462860194-f34da.png 1400w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
